INSERT INTO topics ("id", "title", "description", "category", "image", "created_at", "updated_at", "is_archived", "creator_id") VALUES (1, 'Газотурбинные Двигатели', 'Курс можно адаптировать как для университетских программ, так и для повышения квалификации инженеров.', 'ГТД', 'https://dm.energy/wp-content/uploads/2022/10/dg-90-ugt15000.jpg', '2025-06-23 09:35:04.578122', NULL, 0, 2);
INSERT INTO topics ("id", "title", "description", "category", "image", "created_at", "updated_at", "is_archived", "creator_id") VALUES (2, 'Дизельные Двигатели', 'Устройство, Теория и Эксплуатация', 'Двигатели', 'https://a.d-cd.net/b2b05e1s-480.jpg', '2025-06-23 09:47:33.055769', NULL, 0, 2);
INSERT INTO topics ("id", "title", "description", "category", "image", "created_at", "updated_at", "is_archived", "creator_id") VALUES (4, 'Масляная система', 'Масляная система', 'Масляная система', 'https://studfile.net/html/2706/612/html_TLv5KRglp4.PgNJ/htmlconvd-VBW2I0_html_aae573a0faadb3bc.png', '2025-07-04 13:28:10.921108', NULL, 0, 2);
INSERT INTO sections ("id", "topic_id", "title", "content", "description", "order", "created_at", "updated_at", "is_archived") VALUES (1, 1, 'Раздел 1. Конструкция и принципы работы ГТД', '', 'В этом разделе мы познакомимся с общим устройством газотурбинного двигателя для судов, рассмотрим его основные узлы и термодинамические принципы. Вы поймёте, как работает компрессор, камера сгорания и турбина, и какие параметры влияют на эффективность ГТД в морских условиях.', 0, '2025-07-07 09:17:29.577343', NULL, 0);
INSERT INTO sections ("id", "topic_id", "title", "content", "description", "order", "created_at", "updated_at", "is_archived") VALUES (2, 1, 'Раздел 2. Топливная система ГТД', '', 'Рассмотрим особенности подачи и подготовки топлива в газотурбинных установках, важность качества топлива и требования к его системе. Обсудим фильтрацию, подогрев и регулирование расхода для обеспечения стабильной работы двигателей на флоте.', 0, '2025-07-07 09:43:04.992184', NULL, 0);
INSERT INTO subsections ("id", "section_id", "title", "content", "type", "order", "created_at", "updated_at", "is_archived", "file_path") VALUES (1, 1, 'Основные узлы газотурбинного двигателя', 'Газотурбинный двигатель состоит из трёх ключевых частей: компрессора, камеры сгорания и турбины. Компрессор нагнетает воздух, повышая его давление. Камера сгорания смешивает сжатый воздух с топливом, в результате чего образуются горячие газы. Турбина превращает энергию этих газов в механическую работу, приводя в движение вал или редуктор. Корпус двигателя обеспечивает герметичность, а уплотнения предотвращают утечку. Современные ГТД оснащаются системами охлаждения лопаток и датчиками температуры и давления для оптимального управления.', 'TEXT', 1, '2025-07-07 09:18:03.847780', '2025-07-07 09:49:43.876599', 0, NULL);
INSERT INTO subsections ("id", "section_id", "title", "content", "type", "order", "created_at", "updated_at", "is_archived", "file_path") VALUES (2, 1, 'Рабочий цикл и термодинамические принципы', 'Рабочий цикл газотурбинного двигателя основан на цикле Брайтона: всасывание, сжатие, подача топлива и сгорание, расширение и выпуск. На этапе сжатия компрессор повышает давление воздуха, что улучшает тепловой КПД. В камере сгорания происходит постоянное сгорание топлива при практически неизменном давлении. Затем газы расширяются через турбину, совершая полезную работу. Постоянный поток делает ГТД быстрым в реакции на изменение нагрузки, однако эффективность падает при частичной загрузке.', 'TEXT', 2, '2025-07-07 09:18:17.504965', '2025-07-07 09:49:57.685935', 0, NULL);
INSERT INTO subsections ("id", "section_id", "title", "content", "type", "order", "created_at", "updated_at", "is_archived", "file_path") VALUES (3, 2, '2.1. Компоненты топливной системы', 'Топливная система ГТД включает приёмные баки, фильтры тонкой и грубой очистки, насосы низкого и высокого давления, линии подачи и форсунки. Баки снабжены подогревателями для удаления влаги. Фильтры защищают насосы и форсунки от загрязнений. Насос первого ступеня подаёт топливо к ступенчатому нагнетателю высокого давления, обеспечивая требуемый напор. Параметры системы контролируются датчиками расхода и давления топлива.', 'TEXT', 1, '2025-07-07 09:43:32.435974', NULL, 0, NULL);
INSERT INTO subsections ("id", "section_id", "title", "content", "type", "order", "created_at", "updated_at", "is_archived", "file_path") VALUES (4, 2, '2.2. Система подачи и регулирования расхода топлива', 'Регулирование подачи топлива осуществляется по сигналам от контроллера двигателя: изменение давления на форсунках и длительности впрыска. Пропорциональный клапан дозирует поток, а дросселирующий элемент отвечает за изменение мощности. В аварийных режимах система переходит на ограниченный режим подачи, защищая двигатель от перегрузок. Автоматический регулятор поддерживает оптимальное соотношение воздух/топливо.', 'TEXT', 2, '2025-07-07 09:43:56.095922', NULL, 0, NULL);
